<p>
<p>–ü–æ-–ø–µ—Ä—à–µ, —Ü–µ —è–∫—ñ—Å—Ç—å –∫—Ä—É–ø–∏, –ø–æ-–¥—Ä—É–≥–µ, –ø–µ—Ä–µ—Ä–æ–±–∫–∞, —ñ –≤–∏—Ö—ñ–¥ –∫—Ä—É–ø–∏ ‚Äî –Ω–∞ —Å—å–æ–≥–æ–¥–Ω—ñ—à–Ω—ñ–π –¥–µ–Ω—å —Ü—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ —è–≤–ª—è—î—Ç—å—Å—è –Ω–∞–π–∫—Ä–∞—â–∏–º–∏. –Ø–∫—â–æ –º–∏ –≥–æ–≤–æ—Ä–∏–º–æ –ø—Ä–æ –∫—Ä–µ–º–µ–Ω–∏—Å—Ç—ñ, –º–∏ –æ—Ç—Ä–∏–º—É—î–º–æ –±—ñ–ª—è 10 —Ç, –∑—É–±–æ–≤–∏–¥–Ω—ñ –¥–∞—é—Ç—å –±—ñ–ª—è —Ç. –í—Ä–∞—Ö–æ–≤—É—é—á–∏ —â–µ —Ç–µ, —â–æ –º–∏ –∑–∞–π–º–∞—î–º–æ—Å—å no-till, —Ç–æ –¥–ª—è –Ω–∞—Å —Ü—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –¥–æ—Å–∏—Ç—å –Ω–µ–ø–æ–≥–∞–Ω—ñ. –í–∏—Ä–æ—â—É–≤–∞–ª–∏ –≥—ñ–±—Ä–∏–¥ –ï–° –ë—Ä—ñ–ª–ª—ñ–∞–Ω—Ç. –ì—ñ–±—Ä–∏–¥ –∑–∞–∑–Ω–∞–≤ –∑–Ω–∞—á–Ω–∏—Ö –ø–æ—à–∫–æ–¥–∂–µ–Ω—å –≤—ñ–¥ –∑–Ω–∏–∂–µ–Ω–Ω—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∏ —É —Ñ–∞–∑—É —Ç—Ä—å–æ—Ö –ª–∏—Å—Ç–∫—ñ–≤. –ü—ñ—Å–ª—è –≤—ñ–¥–º–∏—Ä–∞–Ω–Ω—è —Ç—Ä—å–æ—Ö –ª–∏—Å—Ç–∫—ñ–≤ –≤—ñ–¥—Ç–≤–æ—Ä–∏–ª–∏—Å—å –Ω–æ–≤—ñ –ª–∏—Å—Ç–∫–∏, –∑–∞–∫–ª–∞–ª–∏—Å—å –ø–æ–≤–Ω–æ—Ü—ñ–Ω–Ω—ñ –ø–æ—á–∞—Ç–∫–∏. –î–æ–±—Ä–µ —Å–µ–±–µ –ø–æ–∫–∞–∑—É—î –≤ —É—Å–æ–≤–∞—Ö –Ω–∞—à–æ—ó –æ–±–ª–∞—Å—Ç—ñ. –†–µ–∫–æ–º–µ–Ω–¥—É—î–º–æ –¥–ª—è –≥–æ—Å–ø–æ–¥–∞—Ä—Å—Ç–≤ –æ–±–ª–∞—Å—Ç—ñ.</p>
<p>–ì–æ—Å–ø–æ–¥–∞—Ä—Å—Ç–≤–æ –º–∞—î 30 —Ç–∏—Å. –ó –Ñ–≤—Ä–∞–ª—ñ—Å –ø—Ä–∞—Ü—é—î–º–æ –≤–∂–µ –¥–∞–≤–Ω–æ, —ñ –Ω–µ –ø–µ—Ä—à–∏–π —Ä—ñ–∫. –ü–æ–¥–æ–±–∞—î—Ç—å—Å—è, —â–æ –Ω–µ —Ç—Ä–µ–±–∞ –∑–∞–º–æ–≤–ª—è—Ç–∏ –π –ø—Ä–æ—Ç—Ä–∞–≤–ª—é–≤–∞—Ç–∏ —ñ–Ω—Å–µ–∫—Ç–∏—Ü–∏–¥–æ–º.</p><strong><a id='i1'></a><h2>–ü–†–ï–î–°–¢–ê–í–ù–ò–¶–¢–í–ê</h2></strong><p>–ì—ñ–±—Ä–∏–¥–∏ —Å—Ç–∞–±—ñ–ª—å–Ω—ñ, –¥–∞—é—Ç—å –≤—Ä–æ–∂–∞–π –Ω–∞ —Ä—ñ–≤–Ω—ñ —ñ–Ω—à–∏—Ö –Ω–∞—Å—ñ–Ω–Ω—î–≤–∏—Ö –∫–æ–º–ø–∞–Ω—ñ–π, –∞–ª–µ –≤ –Ω–∏—Ö –Ω–∞–π–∫—Ä–∞—â–∞ —Ü—ñ–Ω–∞ –Ω–∞ —Ä–∏–Ω–∫—É —Å–µ—Ä–µ–¥ —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö –∫–æ–º–ø–∞–Ω—ñ–π. –°–æ–Ω—è—à–Ω–∏–∫ –¥–∞—î —É –Ω–∞—Å —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤, –∞ –∫—É–∫—É—Ä—É–¥–∑–∞ ‚Äî —Ü. –ú–∏ –¥—É–∂–µ —Ä–∞–¥—ñ —Å–ø—ñ–≤–ø—Ä–∞—Ü—ñ, —Å–ø–µ—Ü—ñ–∞–ª—ñ—Å—Ç–∏ –Ñ–≤—Ä–∞–ª—ñ—Å –Ω–∞–¥–∞—é—Ç—å –ø—Ä–æ—Ñ–µ—Å—ñ–π–Ω—ñ —Ç–∞ –∑–∞–≤—á–∞—Å–Ω—ñ –∫–æ–Ω—Å—É–ª—å—Ç–∞—Ü—ñ—ó. –í –Ω–∞—à–∏—Ö –ø–ª–∞–Ω–∞—Ö —Ä–æ–∑—à–∏—Ä—é–≤–∞—Ç–∏ –∑ –∫–æ–º–ø–∞–Ω—ñ—î—é —Å–ø—ñ–≤–ø—Ä–∞—Ü—é —ñ –≤ –ø–æ–¥–∞–ª—å—à–æ–º—É. –ü—Ä–∞—Ü—é—é –≤–∂–µ 5 —Ä–æ–∫—ñ–≤ –∞–≥—Ä–æ–Ω–æ–º–æ–º. –°–µ—Ä–µ–¥ –Ω–∏—Ö —Ö–æ—Ç—ñ–ª–æ—Å—å –±–∏ –≤—ñ–¥–º—ñ—Ç–∏—Ç–∏ –≥—ñ–±—Ä–∏–¥ –ë–µ–ª–ª–∞. –í—ñ–Ω –º–µ–Ω—ñ –¥—É–∂–µ —Å–ø–æ–¥–æ–±–∞–≤—Å—è, —Å—ñ—é –π–æ–≥–æ –Ω–∞ –ø–æ–ª–æ–≤–∏–Ω—ñ –≤—Å—ñ—î—ó –ø–ª–æ—â—ñ —Å–æ–Ω—è—à–Ω–∏–∫–∞. –í—ñ–Ω –º–∞—î –≥–∞—Ä–Ω—É —Å—Ç—ñ–π–∫—ñ—Å—Ç—å –¥–æ –≤–æ–≤—á–∫–∞, —Ç–æ–ª–µ—Ä–∞–Ω—Ç–Ω—ñ—Å—Ç—å –¥–æ –Ω–µ—Å–ø—Ä–∏—è—Ç–ª–∏–≤–∏—Ö –ø–æ–≥–æ–¥–Ω–∏—Ö —É–º–æ–≤, —â–æ —î –¥—É–∂–µ –≤–∞–∂–ª–∏–≤–∏–º —Ñ–∞–∫—Ç–æ—Ä–æ–º.</p>
<p>–í—ñ–Ω –∑–∞–≤–∂–¥–∏ —Å—Ç–∞–±—ñ–ª—å–Ω–∏–π, –¥–æ–±—Ä–µ —Ç–æ–ª–µ—Ä–∞–Ω—Ç–Ω–∏–π –¥–æ —Ö–≤–æ—Ä–æ–±. –ì–∞—Ä–Ω–∞ —Å—Ç–∞–±—ñ–ª—å–Ω–∞ —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—å: –∑–∞–≤–∂–¥–∏ –∑–±–∏—Ä–∞—î–º–æ –π–æ–≥–æ –≤—ñ–¥ 30 –¥–æ 35 —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤.</p>
		
	<p>–î—É–∂–µ –≤—ñ–Ω –º–µ–Ω—ñ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è. –î—É–∂–µ –≥–∞—Ä–Ω—ñ –≥—ñ–±—Ä–∏–¥–∏ –≤ –∫–æ–º–ø–∞–Ω—ñ—ó –Ñ–≤—Ä–∞–ª—ñ—Å, —ñ –±—É–¥—É —ñ –Ω–∞–¥–∞–ª—ñ —ó—Ö —Å—ñ—è—Ç–∏ —ñ –ø—Ä–∞—Ü—é–≤–∞—Ç–∏ –∑ –Ñ–≤—Ä–∞–ª—ñ—Å. –í –õ–µ–ª–µ–∫–∞—Ö –∑–µ–º–µ–ª—å–Ω–∏–π —Ñ–æ–Ω–¥ —Å–∫–ª–∞–¥–∞—î –±—ñ–ª—å—à–µ –≥–µ–∫—Ç–∞—Ä. –ó –Ñ–≤—Ä–∞–ª—ñ—Å –ø—Ä–∞—Ü—é—î–º–æ –≤–∂–µ 4 —Ä–æ–∫–∏. –í –Ω–∞—à—ñ–π –∑–æ–Ω—ñ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—î–º–æ –ø–æ—Å—ñ–≤–∏ —Å–æ–Ω—è—à–Ω–∏–∫–∞.</p>
		
	<p>–í –æ—Å–Ω–æ–≤–Ω–æ–º—É, —Ü–µ –ë–µ–ª–ª–∞ –≤—ñ–¥ –Ñ–≤—Ä–∞–ª—ñ—Å. –ó–∞ –æ—Å—Ç–∞–Ω–Ω—ñ 4 —Ä–æ–∫–∏ –ë–µ–ª–ª–∞ —Å–µ–±–µ –ø–æ–∫–∞–∑—É—î —è–∫ –±—ñ–ª—å—à —Å—Ç–∞–±—ñ–ª—å–Ω–∏–π –≥—ñ–±—Ä–∏–¥. –ó–∞ 3 —Ä–æ–∫–∏ —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—å –æ–¥–Ω–æ–∑–Ω–∞—á–Ω–æ —Å–∫–ª–∞–¥–∞–ª–∞ –±—ñ–ª—å—à–µ 3 —Ç–æ–Ω–Ω. –ó —Ü—ñ—î—é —Ñ—ñ—Ä–º–æ—é –Ω–∞–º –ø—Ä–∏—î–º–Ω–æ –ø—Ä–∞—Ü—é–≤–∞—Ç–∏. –ù–∞ –¥–∞–Ω–∏–π —á–∞—Å –≤ –Ω–∞—Å 2 —Ç–∏—Å. –í –º–∏–Ω—É–ª–æ–º—É —Ä–æ—Ü—ñ —Å–µ—Ä–µ–¥–Ω—è —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—å –≤ –Ω–∞—Å –ø–æ–ª—É—á–∏–ª–∞—Å—å –ø–æ –≥–æ—Å–ø–æ–¥–∞—Ä—Å—Ç–≤—É –≤ –º–∞—Å–æ–≤–∏—Ö –ø–æ—Å—ñ–≤–∞—Ö 35 —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤, —Ü–µ –Ω–∞–≤—ñ—Ç—å –±—ñ–ª—å—à–µ –Ω—ñ–∂ –Ω–∞ –¥–µ–º–æ-–ø–æ—Å—ñ–≤–∞—Ö. –ó –∫–æ–º–ø–∞–Ω—ñ—î—é –Ñ–≤—Ä–∞–ª—ñ—Å –º–∏ —Å–ø—ñ–≤–ø—Ä–∞—Ü—é—î–º–æ –≤–∂–µ 4 —Ä—ñ–∫.</p><a id='i2'></a><h3>Other cities Sumy</h3><p>–í–∂–µ 4 —Ä—ñ–∫ –Ñ–≤—Ä–∞–ª—ñ—Å –Ω–∞ –Ω–∞—à–∏—Ö –ø–ª–æ—â–∞—Ö –≤–∏—Ä–æ—â—É—î –¥–µ–º–æ-–ø–æ—Å—ñ–≤–∏. –ú–∏, —è–∫ —Å—ñ–ª—å–≥–æ—Å–ø–≤–∏—Ä–æ–±–Ω–∏–∫–∏, –ø–æ–±–∞—á–∏–ª–∏, —è–∫—ñ –≥—ñ–±—Ä–∏–¥–∏ –±—ñ–ª—å—à–µ –ø—ñ–¥—Ö–æ–¥—è—Ç—å –¥–æ –Ω–∞—à–æ—ó –∑–æ–Ω–∏. –Ø–∫—â–æ —Ä–∞–Ω—ñ—à–µ, –¥–æ –ø—Ä–∞—Ü—ñ –∑ –Ñ–≤—Ä–∞–ª—ñ—Å, –±—É–ª–æ –¥–æ —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤, —ñ —Ü–µ –º–∏ –≤–∂–µ –≤–≤–∞–∂–∞–ª–∏ –¥—É–∂–µ —Ö–æ—Ä–æ—à–æ—é —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—é, —Ç–æ –Ω–∞ —Å—å–æ–≥–æ–¥–Ω—ñ—à–Ω—ñ–π –¥–µ–Ω—å —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—å –≤–∂–µ –¥–æ—Å—è–≥–ª–∞ 35 —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤. –ú–∏ –¥–∞–≤–Ω–æ —Å–ø—ñ–≤–ø—Ä–∞—Ü—é—î–º–æ –∑ —Ü—ñ—î—é –∫–æ–º–ø–∞–Ω—ñ—î—é. –ù–∞–º –ø–æ–¥–æ–±–∞—é—Ç—å—Å—è —ó—Ö–Ω—ñ –≥—ñ–±—Ä–∏–¥–∏. –ì—ñ–±—Ä–∏–¥–∏ —Ä—ñ–ø–∞–∫—É, –Ω–∞–ø—Ä–∏–∫–ª–∞–¥, –Ω–∞–≤—ñ—Ç—å –∑–∞ –∑—Ä—ñ–¥–∂–µ–Ω–∏—Ö –ø–æ—Å—ñ–≤–∞—Ö –ø–æ–∫–∞–∑–∞–ª–∏ 50 —Ü–µ–Ω—Ç–Ω–µ—Ä—ñ–≤. –ö–æ–º–ø–∞–Ω—ñ—è –Ñ–≤—Ä–∞–ª—ñ—Å –º–∞—î –¥—É–∂–µ –ø—Ä–∏—î–º–Ω—É —Ü—ñ–Ω–æ–≤—É –ø–æ–ª—ñ—Ç–∏–∫—É, –ø–æ—Ä—ñ–≤–Ω—è–Ω–æ –∑ –∫–æ–Ω–∫—É—Ä–µ–Ω—Ç–∞–º–∏, —ñ –¥—ñ–π—Å–Ω–æ –Ω–∞—Å—ñ–Ω–Ω—è –∑–∞—Å–ª—É–≥–æ–≤—É—î –Ω–∞ —É–≤–∞–≥—É.</p>
<p>–ó –∫–æ–º–ø–∞–Ω—ñ—î—é "–Ñ–≤—Ä–∞–ª—ñ—Å –°–µ–º–µ–Ω—Å –£–∫—Ä–∞—ó–Ω–∞" –ø—Ä–∞—Ü—é—î–º–æ —Ç—Ä–µ—Ç—ñ–π —Ä—ñ–∫. –ü—Ä–∏ —Ü—å–æ–º—É —É—Ä–æ–∂–∞–π–Ω—ñ—Å—Ç—å –∫—É–∫—É—Ä—É–¥–∑–∏ —Å—Ç–∞–±—ñ–ª—å–Ω–æ –∑—Ä–æ—Å—Ç–∞—î. –í —Ä–æ—Ü—ñ –≤–∏—Å—ñ–≤–∞–ª–∏ –≥—ñ–±—Ä–∏–¥ –ï–° –ö–æ–Ω–∫–æ—Ä–¥.</p>
		
